experience.description:
- синтез органических соединений различных классов (анализ литературных данных, постановка экспериментов, расшифровка ИК, МС, ЯМР-спектров) и изучение их свойств;
- разработка лабораторных и опытно-промышленных регламентов на производство субстанций;
- проектирование новых технологических линий, участие в закупке и пуско-наладке оборудования;
- разработка планов работы сотрудников лаборатории, ежедневный контроль за ходом их выполнения;
- оформление документации по НИОКР, подготовка отчетов, презентаций, письменных и устных докладов;
- ознакомление с современными достижениями в области фармакологии и медицинской химии, поиск новых перспективных препаратов и терапевтических мишеней, выдвижение предложений и разработка проектов последующих работ
